//System define
int total_num = var_num + ec_num;
offb_posctl::controlstate controlstate_msg;
float* tau = new float[pointnumber];
float gap = 2.0/(pointnumber - 1);
std_msgs::Float32 cost_time;

//gradient函数
Matrix Gradient(float x[]) {
	Matrix tmp(total_num, 1);
	float dL[84] = dL(x);
	for (int i = 0; i < var_num; ++i) {
		tmp(i, 0) = dL[i];
	}
	for (int i = 0; i < 5; ++i){
		for (int j = 0; j < 7; ++j){
			tmp(var_num + 7*i + j, 0) = dL[var_num + 7*i + j] + D[j][0]*(x0[i]-x0_default[i]);
		}
	}
	return tmp;
}
//Hessian矩阵函数
Matrix Hessian(float x[]) {
	Matrix tmp(total_num, total_num);
	float HL[84][84] = HL(x);
	for (int i = 0; i < total_num; ++i) {
		for (int j = 0; j < total_num; ++j) {
			tmp(i, j) = HL[i][j];
		}
	}
	return tmp;
}
//一维线搜索函数
float linesearch(Matrix gradient, float x[]) {
	float alpha1 = 0;
	float alpha2 = 0.382;
	float alpha3 = 0.618;
	float alpha4 = 1;
	float tp1, tp2;
	float* tmp = new float[total_num];
	while (alpha4 - alpha1 > epsilon2) {
		for (int i = 0; i < var_num; ++i) {
			tmp[i] = x[i] - alpha2 * gradient(i, 0);
		}
		tp1 = f(tmp);
		for (int i = 0; i < var_num; ++i) {
			tmp[i] = x[i] - alpha3 * gradient(i, 0);
		}
		tp2 = f(tmp);
		if (tp1 < tp2) {
			alpha4 = alpha3;
			alpha3 = alpha2;
			alpha2 = alpha1 + 0.382 * (alpha4 - alpha1);
		}
		else {
			alpha1 = alpha2;
			alpha2 = alpha3;
			alpha3 = alpha1 + 0.618 * (alpha4 - alpha1);
		}
	}
	return alpha2;
}
//QP子问题
Matrix SubQP(float x[], bool& flag) {
	float alpha1, alpha2, tp1, tp2;
	Matrix gradient(total_num, 1);
	Matrix hessian(total_num, total_num);
	Matrix p(total_num, 1);
	float* tmp = new float[total_num];
	hessian = Hessian(x);
	gradient = Gradient(x);
	p = hessian.solve(gradient, flag);
	alpha1 = linesearch(p, x);
	for (int i = 0; i < var_num; ++i) {
		tmp[i] = x[i] - alpha1 * p(i, 0);
	}
	tp1 = f(tmp);  //沿SQP方向搜索
	alpha2 = linesearch(gradient, x);
	for (int i = 0; i < var_num; ++i) {
		tmp[i] = x[i] - alpha2 * gradient(i, 0);
	}
	tp2 = f(tmp);  //沿梯度方向搜索
	if (tp1 < tp2) {
		p = p*alpha1;
	}
	else {
		p = gradient*alpha2;
	}
	delete[] tmp;
	return p;
}

void plane_vel_cb(const geometry_msgs::TwistStamped::ConstPtr &msg){
    x0[4] = msg->twist.linear.x;
}

void pos_twist_cb(const nav_msgs::Odometry::ConstPtr &msg){
    x0[0] = msg->pose.pose.position.x;
	x0[1] = msg->pose.pose.position.z;
	x0[2] = msg->twist.twist.linear.x;
	x0[3] = msg->twist.twist.linear.z;
}


int main(int argc, char **argv)
{
  ros::init(argc, argv, "SQP_control");
  ros::NodeHandle nh;
  // 消息设置
  ros::Subscriber current_relativepostwist_pub = nh.subscribe<nav_msgs::Odometry>("current_relative_postwist", 1, pos_twist_cb);//当前状态方程中的状态量,即相对量
  ros::Subscriber plane_velocity_sub = nh.subscribe<geometry_msgs::TwistStamped>("mavros/local_position/velocity_local", 1, plane_vel_cb); //twist
  ros::Publisher controlstate_pub = nh.advertise<offb_posctl::controlstate>("SQP_controlstate", 1);
  ros::Publisher time_cost_pub = nh.advertise<std_msgs::Float32>("time_cost", 1); //time cost per calculation
  ros::Rate loop_rate(50);
  for (int i = 0; i < pointnumber; ++i){
	tau[i] = -1 + gap*i;
  }
  int count = 0;
  clock_t start, end;
  bool loop_flag, pub_flag;
  float* x = new float[total_num];
  Matrix poly_x(5, 8);
  Matrix poly_u(2, 7);
  Matrix L_1(8, 8);
  for (int i = 0; i < 8; ++i){
	  for (int j = 0; j < 8; ++j){
		  L_1(i, j) = L1[i][j];
	  }
  }
  Matrix L_2(7, 7);
  for (int i = 0; i < 7; ++i){
	  for (int j = 0; j < 7; ++j){
		  L_2(i, j) = L2[i][j];
	  }
  }
  Matrix res(6, pointnumber);
while (ros::ok()){
	count = 0;
	start = clock();
	loop_flag = false;
	pub_flag = true;
	srand((unsigned)time(NULL));
  	for (int i = 0; i < total_num; ++i) {
		x[i] = rand() / float(RAND_MAX);
  	}
	while (!loop_flag && count < 25 && pub_flag) {
		loop_flag = true;
		Matrix p = SubQP(x, pub_flag);
		for (int i = 0; i < var_num; ++i) {
			if (p.norm() > epsilon1) {
				loop_flag = false;
			}
		}
		for (int i = 0; i < var_num; ++i) {
			x[i] -= p(i, 0);
		}
		++count;
	}
	if (!pub_flag){
		continue;
	}
	for (int i = 0; i < 5; ++i){
		poly_x(i, 0) = x0[i];
	}
	for (int i = 0; i < 5; ++i){
		for (int j = 1; j < 8; ++j){
			poly_x(i, j) = x[i + 7*j - 7];
		}
	}
	for (int i = 0; i < 2; ++i){
		for (int j = 0; j < 7; ++j){
			poly_u(i, j) = x[i + 7*j + 5];
		}
	}
	poly_x = poly_x*L_1;
	poly_u = poly_u*L_2;
	for (int i = 0; i < 4; ++i){
		for (int j = 0; j < pointnumber ;++j){
			res(i, j) = 0;
			for (int k = 0; k < 8; ++k){
				res(i, j) = res(i, j)*tau[j] + poly_x(i, k);
			}
		}
	}
	for (int i = 4; i < 6; ++i){
		for (int j = 0; j < pointnumber ;++j){
			res(i, j) = 0;
			for (int k = 0; k < 7; ++k){
				res(i, j) = res(i, j)*tau[j] + poly_u(i - 4, k);
			}
		}
	}
	end = clock();
    cost_time.data = float(end - start)/CLOCKS_PER_SEC *1000;
    time_cost_pub.publish(cost_time);
    controlstate_msg.inicounter = 0;
    controlstate_msg.discrepointpersecond = discretized_point_persecond;
    controlstate_msg.arraylength = pointnumber;
	vector<float> x1(&res.index[0*pointnumber], &res.index[1*pointnumber]);
	vector<float> x2(&res.index[1*pointnumber], &res.index[2*pointnumber]);
	vector<float> x3(&res.index[2*pointnumber], &res.index[3*pointnumber]);
	vector<float> x4(&res.index[3*pointnumber], &res.index[4*pointnumber]);
	vector<float> u1(&res.index[4*pointnumber], &res.index[5*pointnumber]);
	vector<float> u2(&res.index[5*pointnumber], &res.index[6*pointnumber]);
	controlstate_msg.thrustarray = u1;
    controlstate_msg.thetaarray = u2;
    controlstate_msg.stateXarray = x1;
    controlstate_msg.stateZarray = x2;
    controlstate_msg.stateVXarray = x3;
    controlstate_msg.stateVZarray = x4;
	controlstate_pub.publish(controlstate_msg);
    ros::spinOnce();
    loop_rate.sleep();
  }
  return 0;
}
